SELECT a.IDXDOCCATALOGO as IDXDOCCATALOGO,a.GROUPUSER as GROUPUSER,a.GROUPCLIENT as GROUPCLIENT,a.COUSERMODIF as COUSERMODIF,a.COUSERALTA as COUSERALTA,a.CATALOGO as CATALOGO,a.CARPETA as CARPETA,a.AGRUPAR as AGRUPAR,a.ACTIVO as ACTIVO,a.ACCESOCLI as ACCESOCLI,a.IDMMODULO0 as IDMMODULO0,aa.MODULO as MODULO FROM DOCCATALOGO a
 INNER JOIN 
MMODULO aa ON aa.IDXMMODULO = a.IDMMODULO0;
